import React from 'react';
import IconHelp from './IconHelp';
import IconUser from './IconUser';
import IconCart from './IconCart';

const Icon = () =>{
    return (
        <div>
            <IconHelp title="Help"/>
            <IconUser title="Sign In"/>
            <IconCart title="Shopping Cart"/>
        </div>
    );
}
export default Icon;
